using System;using HECSFramework.Core;using Newtonsoft.Json;using HECSFramework.Serialize;namespace HECSFramework.Serialize{	[JsonObject, Serializable]	public partial struct JSONTestSerializeJSONResolver : IJSONResolver<JSONTestSerialize,JSONTestSerializeJSONResolver>	{		[JsonProperty("Data")]		public int Data;		[JsonProperty("Check")]		public string Check;		[JsonProperty("PartialData")]		public int PartialData;		[JsonProperty("CheckThrowResolver")]		public CheckThrow CheckThrowResolver;		[JsonProperty("Data2")]		public int Data2;		[JsonProperty("Common")]		public string Common;		[JsonProperty("CheckData")]		public TestPrivateResolver CheckData;		public JSONTestSerializeJSONResolver In(ref JSONTestSerialize jsontestserialize)		{			jsontestserialize.BeforeSync();			this.Data = jsontestserialize.Data;			this.Check = jsontestserialize.Check;			this.PartialData = jsontestserialize.PartialData;			this.CheckThrowResolver = new CheckThrow().In(ref jsontestserialize.CheckThrowResolver);			this.Data2 = jsontestserialize.Data2;			jsontestserialize.SaveToJSONResolver(ref this);			return this;		}		public void Out(ref JSONTestSerialize jsontestserialize)		{			jsontestserialize.Data = this.Data;			jsontestserialize.Check = this.Check;			jsontestserialize.PartialData = this.PartialData;			this.CheckThrowResolver.Out(ref jsontestserialize.CheckThrowResolver);			jsontestserialize.Data2 = this.Data2;			jsontestserialize.LoadFromJSONResolver(ref this);			jsontestserialize.AfterSync();		}	}}namespace HECSFramework.Serialize{	public partial class JSONTestSerialize : ISaveJSONToResolver<JSONTestSerializeJSONResolver>, ILoadFromJSONResolver<JSONTestSerializeJSONResolver>	{		public void SaveToJSONResolver(ref JSONTestSerializeJSONResolver resolver)		{			resolver.Common = Common;			resolver.CheckData = new TestPrivateResolver().In(ref CheckData);		}		public void LoadFromJSONResolver(ref JSONTestSerializeJSONResolver resolver)		{			Common = resolver.Common;			resolver.CheckData.Out(ref CheckData);		}	}}